import Button from '../../UI/Button';
import deleteIcon from '../../../images/icon-check.svg';
import classes from './ListItem.module.css';

const ListItem = () => {
  return (
    <li className={classes.item}>
      <label htmlfor='myradioId' className={classes.radio}>
        <input type='radio' id='myRadioId' className={classes['radio__input']}></input>
        <div className={classes['custom-radio']}></div>
        <p>loremscjnald</p>
      </label>

      <Button><img></img></Button>
    </li>
  )
}

export default ListItem;
